import{a as u,b as r}from"./chunk-3ZDOC5Y5.js";var a={};u(a,{default:()=>m,firstName:()=>l,information:()=>p,lastName:()=>d,projects:()=>c});var l="Gabin",d="Mussio",p={image:"Me.jpg",git:"https://github.com/CambriHobbit",mail:"gabin.mussio@laposte.net",phone:"0767100932",age:20,mesPassion:[{intitule:"Le Seigneur des Anneaux",image:"LOTR.png",orientation:"droite",class:"lotr",texte:`Comment j'ai d\xE9couvert cet univers ? C'est tr\xE8s simple un jour : "Le Seigneur des Anneaux" est pass\xE9 \xE0 la t\xE9l\xE9vision et j'ai tout de suite aim\xE9 cet univers. L'un des aspects les plus remarquables de l'univers de Tolkien est son attention aux d\xE9tails. Chaque peuple, qu'il s'agisse des Elfes, des Nains, des Hommes ou des Hobbits, poss\xE8de sa propre histoire, sa propre langue et ses propres coutumes. Tolkien a d\xE9velopp\xE9 des langues compl\xE8tes pour ces races, donnant ainsi une profondeur et une cr\xE9dibilit\xE9 \xE0 son univers. En plus de son souci du d\xE9tail, Tolkien a \xE9galement r\xE9ussi \xE0 cr\xE9er une mythologie riche et authentique. Son univers regorge de l\xE9gendes anciennes, de r\xE9cits \xE9piques et de contes populaires. Ces histoires nous transportent dans un monde de magie, de h\xE9ros et de qu\xEAtes \xE9piques. On retrouve ces mythes et ces l\xE9gendes dans plusieurs de ses livres tels que "Le Silmarion" ou encore "Contes et l\xE9gendes inachev\xE9s". Un autre aspect remarquable de l'univers de Tolkien est sa profondeur \xE9motionnelle. Ses personnages sont vivants, complexes et profond\xE9ment humains. De Frodon Sacquet, le courageux porteur de l'Anneau, \xE0 Aragorn, le roi guerrier, en passant par Gandalf, le sage magicien, chaque personnage est dot\xE9 d'une personnalit\xE9 unique et d'une histoire fascinante. Les relations entre les personnages, leurs luttes internes et leurs triomphes nous touchent et nous font r\xE9fl\xE9chir sur la nature de l'amiti\xE9, du courage et du sacrifice. Enfin, l'univers de Tolkien est impr\xE9gn\xE9 d'une profonde mythologie et d'une r\xE9flexion philosophique. Il explore des th\xE8mes tels que le bien et le mal, la destin\xE9e, le pouvoir corrupteur et la valeur de la nature et de la beaut\xE9. Tolkien \xE9tait lui-m\xEAme un fervent d\xE9fenseur de la nature, et cette passion se refl\xE8te dans son \u0153uvre. Son univers nous invite \xE0 r\xE9fl\xE9chir sur notre propre monde et sur notre place en tant qu'\xEAtres humains.`},{intitule:"L'histoire de la Savoie",image:"savoie.jpg",orientation:"gauche",class:"savoie",texte:"L'histoire de la Savoie est une saga captivante qui remonte \xE0 des si\xE8cles, remplie d'\xE9v\xE9nements \xE9piques, de personnages illustres et d'une identit\xE9 culturelle riche. Du c\u0153ur des Alpes aux vall\xE9es verdoyantes, la Savoie a \xE9t\xE9 le th\xE9\xE2tre d'un r\xE9cit dynamique qui a fa\xE7onn\xE9 la r\xE9gion et influenc\xE9 l'Europe. L'une des caract\xE9ristiques les plus fascinantes de l'histoire de la Savoie est son h\xE9ritage dynastique. La Maison de Savoie, une famille noble originaire de la r\xE9gion, a jou\xE9 un r\xF4le essentiel dans la formation et l'\xE9volution de la Savoie. De modestes comtes, ils ont progressivement \xE9tendu leur pouvoir et leur influence, devenant d'abord ducs, puis rois de Sardaigne. Leurs r\xE9alisations politiques et militaires, notamment la cr\xE9ation du royaume de Sardaigne, ont marqu\xE9 l'histoire europ\xE9enne. L'emplacement g\xE9ographique strat\xE9gique de la Savoie en a \xE9galement fait un carrefour culturel et politique majeur. Situ\xE9e au croisement de l'Italie, de la France et de la Suisse, la Savoie a \xE9t\xE9 le th\xE9\xE2tre de nombreux conflits et \xE9changes, fa\xE7onnant ainsi son destin. Les cit\xE9s m\xE9di\xE9vales, les ch\xE2teaux imposants et les forts perch\xE9s t\xE9moignent des nombreux combats et si\xE8ges qui ont eu lieu dans la r\xE9gion. Cette histoire mouvement\xE9e a laiss\xE9 une empreinte ind\xE9l\xE9bile sur le paysage savoisien et contribu\xE9 \xE0 forger une identit\xE9 forte et fi\xE8re. La richesse culturelle de la Savoie est un autre \xE9l\xE9ment qui m\xE9rite d'\xEAtre soulign\xE9. La r\xE9gion a pr\xE9serv\xE9 ses traditions ancestrales, ses dialectes et ses coutumes, cr\xE9ant ainsi un tissu social unique. De plus, la Savoie est c\xE9l\xE8bre pour sa gastronomie d\xE9licieuse, mettant en avant des plats tels que la fondue, la tartiflette et les fromages renomm\xE9s comme le Beaufort et l'Abondance. Les vins de Savoie, issus de vignobles en terrasses nich\xE9s dans les montagnes, sont \xE9galement r\xE9put\xE9s pour leur qualit\xE9 exceptionnelle. Enfin, l'histoire de la Savoie est indissociable de ses paysages \xE9poustouflants. Les majestueuses montagnes alpines, les lacs scintillants et les vall\xE9es verdoyantes offrent un cadre naturel spectaculaire \xE0 cette histoire."},{intitule:"Counter-Strike",image:"CS.jpg",orientation:"droite",class:"counter-strike",texte:`Counter-Strike est l'un de mes jeux vid\xE9os pr\xE9fer\xE9. C'est un "FPS" (First Personnel Shooter, jeu de tir \xE0 la premi\xE8re personne) en cinq contre cinq qui n\xE9cessite d'\xEAtre astucieux pour gagner. Ce jeu est l'un des premiers jeu sur PC auquel j'ai jou\xE9. C'est l'un des jeux o\xF9 l'on peut jouer avec ses amis, rigoler ensemble ou encore se donner au maximum tous ensemble. Counter-Strike est une franchise o\xF9 l'on retrouve de l'e-sport avec des tournois spectaculaires. Counter-Stike est l'un des "FPS" les plus jou\xE9 dans le monde. Ce jeu poss\xE8de des cartes mythiques, des joueurs et des structures l\xE9gendaires. `}],mesOuvragePref:["Le Seigneur des Anneaux et Le Silmarion, de J.R.R. Tolkien","Le Tr\xF4ne de fer, de G.R.R. Martin","Trois cents, de F. Miller"],mesPeinturePref:["La nuit \xE9toil\xE9e, de V. Van Gogh","La Cr\xE9ation d'Adam, de Michel-Ange","La C\xE8ne, de L. DaVinci","Le Cri, de Munch"],mesDesignPatterPref:["Smart-Dumb","Iterator","Composite","Observeur"],monHistoire:"Passionn\xE9 par les jeux vid\xE9os et l'informatique, j'ai d\xE9cid\xE9 d'orienter mes \xE9tudes dans ces domaines. C'est pour cela que d\xE8s le lyc\xE9e, j'ai pris comme sp\xE9cialit\xE9s NSI (Num\xE9rique et Science de l'Informatique) ainsi que les Math\xE9matiques et la Physique Chimie. J'ai gard\xE9 la NSI et les Math\xE9matiques en terminal pour avoir un Bac orient\xE9 vers l'informatique. Une fois le Bac mention bien obtenu, je me suis orient\xE9 vers un BUT informatique avec pour objectif d'enrichir mes comp\xE9tences dans le d\xE9veloppement d'applications.",situation:"Etudiant en deuxi\xE8me ann\xE9e du BUT Informatique de Grenoble IUT2, 2 place Doyen Gosse"},c=[{type:"univ",id:"I",name:"Installation et configuration d'un poste de travail",subject:"Le but de ce projet consiste \xE0 l'installation d'une machine virtuelle sous Debian. Apr\xE8s l'installation de celle-ci, on a d\xFB installer des applications tels que PostgreSQL, Apache et PHP afin de se servir de la machine virtuelle comme un serveur.",competenceTechnique:["Utilisation du gestionnaire de paquet APT","Installation et utilisation d'une interface en ligne commande","Installation d'un service r\xE9seau"],competenceTransversal:["Interpr\xE9ter et r\xE9soudre une erreur","Mod\xE9liser et comprendre un r\xE9seau"],keyWords:["Bash"]},{type:"univ",id:"II",name:"Cr\xE9ation, nettoyage et analyse de donn\xE9es",subject:"Ce projet en bin\xF4me a pour but la cr\xE9ation d'une base de donn\xE9es puis l'analyse de ces derni\xE8res. Dans un premier temps, on a r\xE9cuper\xE9 les donn\xE9es depuis un fichier csv, ensuite on a d\xFB les nettoyer afin de garder les plus pertinentes. Par la suite, on a r\xE9cuper\xE9 ces donn\xE9es afin de les utiliser pour en faire des graphiques et une analyse statistique.",competenceTechnique:["Importation et exportation d'une base de donn\xE9es","Manipulation de PostgreSQL et Rstudio","Utilisation de SQL et de R"],competenceTransversal:["Travail d'\xE9quipe","Interpr\xE9tation de contraintes et de donn\xE9es","S\xE9lection de donn\xE9es pertinentes"],keyWords:["SQL","R"]},{type:"univ",id:"III",name:"Mise en avant de la transition \xE9cologique et num\xE9rique d'une entreprise du service num\xE9rique",subject:"Dans le cadre de ce projet en trin\xF4me, on a d\xFB choisir une entreprise du service num\xE9rique afin d'\xE9tudier son approche de l'\xE9cologie et de sa transition num\xE9rique. Apr\xE8s cette \xE9tude, nous avons d\xFB r\xE9aliser un site web r\xE9capitulatif de ce que l'on avait trouv\xE9 dans notre \xE9tude. De m\xEAme, nous avons d\xFB vulgariser le contenu technique afin que le plus de personnes puissent comprendre le sujet.",competenceTechnique:["Utilisation de HTML et de CSS","Vulgarisation de terme technique"],competenceTransversal:["Travail d'\xE9quipe","Interpr\xE9tation de la transition \xE9cologique et num\xE9rique d'une entreprise","S\xE9lection de donn\xE9es pertinentes"],keyWords:["HTML","CSS"]},{type:"univ",id:"IV",name:"Cr\xE9ation d'une application de gestion d'\xE9v\xE8nements",subject:"L'objectif de ce projet est la cr\xE9ation d'une application de gestion d'\xE9v\xE8nements. Pour ce projet, nous \xE9tions une \xE9quipe de cinq personnes. Ce projet avait besoin d'une grande organisation, et donc de planification. On a d\xFB mettre en place une buvette virtuelle et optimiser sa fonction de gain. On a d\xFB d\xE9velopper l'interface de cette application en Java et JavaFXML et mod\xE9liser en amont cette interface.",competenceTechnique:["Utilisation de JavaFX et de UML","Optimisation d'une fonction","Gestion d'une \xE9quipe","Conception d'une maquette et de diagrammes"],competenceTransversal:["Travail d'\xE9quipe","Mod\xE9lisation d'un probl\xE8me et r\xE9solution"],keyWords:["Java","XML"]},{type:"univ",id:"V",name:"Impl\xE9mentation d'un besoin et comparaison d'approche algorithmique",subject:"Le but de ce projet en bin\xF4me \xE9tait la cr\xE9ation d'un programme en Java auquel nous avons donn\xE9 un fichier contenant des mots associ\xE9s \xE0 un nombre. Ensuite, il classait les diff\xE9rents articles selon leur th\xE8me, avec plus ou moins d'erreurs. Dans un second temps, pour avoir plus de pr\xE9cisions, nous avons automatis\xE9 la cr\xE9ation du fichier contenant les mots avec un poids associ\xE9. On lui a donn\xE9 une liste d'articles avec un th\xE8me pr\xE9cis. Si le mot n'apparait pas dans le th\xE8me, on lui ajoute 'un' \xE0 son poids. Puis on change de th\xE8me. Si le mot apparait de nouveau dans le th\xE8me, on d\xE9cr\xE9mente son poids. Par la suite, on a supprim\xE9 les mots avec un poids tr\xE8s n\xE9gatif car la plupart du temps ces mots ne sont pas significatifs d'un th\xE8me pr\xE9cis. Par exemple, les pronoms et les conjonctions de coordination ne sont pas significatifs. Pour finir, on a test\xE9 de nouveau sur les m\xEAmes articles, et le pourcentage d'erreur \xE9tait tr\xE8s faible, inf\xE9rieur \xE0 10%.",competenceTechnique:["Utilisation de Java",`Mise en place d'un algorithmique qui "apprend"`,"La programmation \xE0 plusieurs"],competenceTransversal:["Travail en bin\xF4me","Impl\xE9mentation d'un besoin",'Compr\xE9hension algorithmique (algorithmique qui "apprend par lui-m\xEAme")'],keyWords:["Java"]},{type:"perso",id:"VI",name:"Cr\xE9ation d'un terrain de p\xE9tanque",subject:"Afin de r\xE9unir ma famille ou mes amis, j'ai eu le projet de la cr\xE9ation d'un terrain de p\xE9tanque.",option:[{numEtape:1,nomEtape:"Faire les plans",imgEtape:"Plan.jpg",commentaireEtape:"Ceci est une \xE9tape importante pour mod\xE9liser la situation et se rendre ccompte du travail."},{numEtape:2,nomEtape:"D\xE9limiter la zone et la creuser",imgEtape:"EtapeII.jpg",commentaireEtape:"Anecdote/Conseil: Ne pas prendre un d\xE9cam\xE8tre en tissu des ann\xE9es 60, le tissu rapetisse dans le temps !"},{numEtape:3,nomEtape:"Poser le g\xE9otextile, les traverses, puis d\xE9poser le gravier.",imgEtape:"EtapeIII.jpg",commentaireEtape:"Conseil: pour une meilleure exp\xE9rience mettre son terrain \xE0 niveau."},{numEtape:4,nomEtape:"Jouer !",imgEtape:"terrain-de-petanque.jpg",commentaireEtape:"Conseil: Inviter des amis et passer un bon moment."}],keyWords:["P\xE9tanque","Amis"]},{type:"univ",id:"VII",name:"Cr\xE9ation d'un jeu ludo-\xE9ducatif",subject:"Au sein d\u2019une \xE9quipe de 8, il fallait cr\xE9er une application en suivant une d\xE9marche de d\xE9veloppement it\xE9rative ou incr\xE9mentale. En partant d'un besoin d\xE9crit de mani\xE8re impr\xE9cise ou incompl\xE8te par un client, l'objectif est de clarifier/compl\xE9ter, collecter et formaliser le besoin puis de d\xE9velopper une application communicante int\xE9grant la manipulation des donn\xE9es et respectant les paradigmes de qualit\xE9 (ergonomie des interfaces, qualit\xE9 logicielle). Il \xE9tait n\xE9cessaire de mobiliser les ressorts du jeu, r\xE9compense et frustration (progression, score), afin de favoriser l'apprentissage et la motivation. Contrairement \xE0 un jeu vid\xE9o classique, ces m\xE9canismes doivent prendre part au dispositif p\xE9dagogique, le tout afin de motiver les utilisateurs, de leur apporter des informations, un savoir-faire ou un entra\xEEnement. Il convenait d\u2019ajouter un aspect comp\xE9titif afin de le rendre plus engageant. Nous avons utilis\xE9 Phaser, un framework  JavaScript.",competenceTechnique:["Travail en \xE9quipe","Prise en main d'un nouveau framework","Mise en place d'un syst\xE8me de connexion","Cr\xE9ation d'une base de donn\xE9es"],competenceTransversal:["Cr\xE9ation de jeu ludo-\xE9ducatif","Choisir un langage de programmation adapter \xE0 nos besoin"],keyWords:["JavaScript","Phaser","PHP","SQL","HTML","CSS"]},{type:"univ",id:"VIII",name:"Am\xE9liorer et optimiser une application existante ",subject:"L\u2019application a pour but de renseigner un carnet de recherche de stage pour consulter les offres disponibles et faire le suivi des candidatures en cours jusqu\u2019au choix d\u2019une proposition parmi plusieurs r\xE9ponses positives. Elle concerne deux acteurs : le responsable des stages, qui g\xE8re les offres de stage et les \xE9tudiants qui candidatent \xE0 des offres. L\u2019application ne couvre pas la suite du processus qui est d\u2019ordre administratif. On avait \xE0 disposition deux applications: une application en Android et une autre en PHP. Dans ces applications, il y avait diff\xE9rents probl\xE8mes tels que l'ergonomie et un code mal organis\xE9 et ne respectant pas de bonnes normes.",competenceTechnique:['Utilisation de "Merge Request" ',"D\xE9veloppement Android, PHP et SQL"],competenceTransversal:["Annalyser l'ergonomie d'une application","Travail d'\xE9quipe"],keyWords:["Android","Synfony","PHP","SQL"]},{type:"pro",id:"IX",name:"Moderniser une application interne",subject:"Modernisation d'une application interne \xE0 l'entreprise en angular",competenceTechnique:["Cr\xE9ation d'une application angular","Utilisation des outils propres \xE0 TypeScript"],competenceTransversal:["Prise en main d'outils","Travail en entreprise","Revue de code"],keyWords:["Stage","Angular","TypeScript"]}],m={firstName:l,lastName:d,information:p,projects:c};var g=(()=>{let e=class e{constructor(){this.user=a}getUser(){return this.user}getListProject(){return this.user.projects}getInformations(){return this.user.information}getProjectFromID(i){let n=this.getListProject().find(o=>o.id==i);if(n==null)throw Error("Not in");return n}getProjectFromType(i){return this.getListProject().filter(n=>n.type==i)}};e.\u0275fac=function(n){return new(n||e)},e.\u0275prov=r({token:e,factory:e.\u0275fac,providedIn:"root"});let s=e;return s})();export{g as a};
